import React, { useState } from "react";
import "./DoctorSearchPage.css";
import { FaChevronDown } from "react-icons/fa";

const DoctorFilters = () => {
  const [openFilter, setOpenFilter] = useState(null);

  const toggleFilter = (name) => {
    setOpenFilter(openFilter === name ? null : name);
  };

  return (
    <div className="filter-bar">
      {/* Gender */}
      <div className="filter-card" onClick={() => toggleFilter("gender")}>
        Gender <FaChevronDown />
        {openFilter === "gender" && (
          <div className="filter-dropdown">
            <div>Male Doctor</div>
            <div>Female Doctor</div>
          </div>
        )}
      </div>

      {/* Experience */}
      <div className="filter-card" onClick={() => toggleFilter("experience")}>
        Experience <FaChevronDown />
        {openFilter === "experience" && (
          <div className="filter-dropdown">
            <div>5+ years</div>
            <div>10+ years</div>
            <div>12+ years</div>
            <div>15+ years</div>
            <div>18+ years</div>
            <div>20+ years</div>
          </div>
        )}
      </div>

      {/* All Filters */}
      <div className="filter-card" onClick={() => toggleFilter("all")}>
        All Filters <FaChevronDown />
        {openFilter === "all" && (
          <div className="filter-dropdown" style={{ width: "300px" }}>
            <strong>Associated with top hospitals</strong>
            <div>Manipal Hospitals</div>
            <div>Apollo White Dental</div>

            <br />
            <strong>Fees</strong>
            <div>₹0-₹500</div>
            <div>Above ₹500</div>
            <div>Above ₹1000</div>
            <div>Above ₹2000</div>

            <br />
            <strong>Availability</strong>
            <div>Available in next 4 hours</div>
            <div>Available Today</div>
            <div>Available Tomorrow</div>
            <div>Available in next 7 days</div>

            <br />
            <strong>Consult type</strong>
            <div>Video consult</div>
          </div>
        )}
      </div>

      {/* Relevance (just a dropdown UI) */}
      <div className="filter-card" onClick={() => toggleFilter("relevance")}>
        Relevance <FaChevronDown />
        {openFilter === "relevance" && (
          <div className="filter-dropdown">
            <div>Relevance</div>
            <div>Rating</div>
            <div>Experience</div>
            <div>Price (Low to High)</div>
            <div>Price (High to Low)</div>
          </div>
        )}
      </div>
    </div>
  );
};

export default DoctorFilters;
